import React from "react";
import waterfall from "../Images/waterfall.jpeg";

function AboutMe() {
  return (
    <div className="about-me">
      <div className="about-me-image">
        
      </div>
      <img src={waterfall} className="about-me-image"></img>
    </div>
  );
}

export default AboutMe;
